// ActionBar.js
import React from 'react';
import { IconButton } from '@mui/material';
import CloudUploadIcon from '@mui/icons-material/CloudUpload';
import EventIcon from '@mui/icons-material/Event'; // Google Calendar sync icon
import MicIcon from '@mui/icons-material/Mic'; // Sound record icon
import EmailIcon from '@mui/icons-material/Email'; // Email icon
import GetAppIcon from '@mui/icons-material/GetApp'; // Download icon

const ActionBar = ({ onFileUpload, onRecord, onCalendarSync, onEmail, onDownload }) => {
  return (
    <div style={{ display: 'flex', alignItems: 'center', gap: '8px' }}>
      <IconButton color="primary" component="label">
        <CloudUploadIcon />
        <input type="file" hidden onChange={(e) => onFileUpload(e.target.files)} accept=".pdf,.doc,.docx" />
      </IconButton>
      <IconButton color="primary" onClick={onCalendarSync}>
        <EventIcon />
      </IconButton>
      <IconButton color="primary" onClick={onRecord}>
        <MicIcon />
      </IconButton>
      <IconButton color="primary" onClick={onEmail}>
        <EmailIcon />
      </IconButton>
      <IconButton color="primary" onClick={onDownload}>
        <GetAppIcon />
      </IconButton>
    </div>
  );
};

export default ActionBar;
